import React, { Component } from "react";
// import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";

import { Map as LeafletMap, TileLayer, Marker, Popup } from 'react-leaflet';

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import Loteos_Map from "./components/loteos_map";
import Piece_of_Ground_Map from "./components/piece_of_ground_map.component";

// Component 
class App extends Component {

	// render method
	render() {

		return (

			<Router>

			    <div className="container">

					<nav className="navbar navbar-expand-lg navbar-light bg-light">

						<Link to="/" className="navbar-brand"> 

							Tu parcela en 5 simples pasos

						</Link>

						<Link to="/piece_of_ground" className="navbar-brand"> 

							Tu parcela en 5 simples pasos

						</Link>

						<div className="collpase navbar-collapse">

							<ul className="navbar-nav mr-auto">

								<li className="navbar-item">

									<Link to="/" className="nav-link">

										Todos

									</Link>

								</li>

							</ul>

						</div>

					</nav>

			    </div>

		    <Route path = "/" exact component = {Loteos_Map} />

		    <Route path = "/piece_of_ground" exact component = {Piece_of_Ground_Map} />

			</Router>

		);

	}

}

// exporting app
export default App;
